import {
    FETCH_PROFILE_SUCCESS,
    FETCH_PROFILE_FAILURE
} from 'actionsType'

const initialState =[
]

export default (state = initialState, {type, payload})=>{
    switch (type){
        case FETCH_PROFILE_SUCCESS:
            return payload
        case FETCH_PROFILE_FAILURE:
            return payload
        default:
            return state
    }

}